DROP TABLE IF EXISTS `t_far_config`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_far_config` (
  `C_FACE` varchar(20) NOT NULL COMMENT '接口名称',
  `C_NAME` varchar(100) NOT NULL COMMENT '配置名称',
  `C_VALUE` varchar(200) DEFAULT NULL COMMENT '配置内容',
  `C_TYPE` varchar(30) DEFAULT NULL COMMENT '配置类型',
  `C_SPLIT` varchar(1) DEFAULT NULL COMMENT '是否分割为,0不分割，1分割为数组，2分割为有序的MAP',
  `C_SCOPE` varchar(1) DEFAULT NULL COMMENT '应用范围，0无；1接口申请，2接口返回，3页面调用申请，4页面调用返回',
  `C_DESCRIPTION` varchar(200) DEFAULT NULL COMMENT '配置说明',
  `N_ORDER` smallint(6) DEFAULT NULL COMMENT '参数顺序，如果需要可以配置',
  `ID` smallint(6) DEFAULT NULL COMMENT '编号',
  PRIMARY KEY (`C_FACE`,`C_NAME`),
  KEY `IDX_FAR_CONFIG` (`C_FACE`,`C_TYPE`,`C_NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='远程接口调用参数配置';
/*!40101 SET character_set_client = @saved_cs_client */;

