--
-- Table structure for table `t_far_fieldmap`
--

DROP TABLE IF EXISTS `t_far_fieldmap`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_far_fieldmap` (
  `C_FACE` varchar(16) NOT NULL COMMENT '接口',
  `C_FUNCODE` varchar(40) NOT NULL COMMENT '功能代码',
  `N_ORDER` smallint(6) NOT NULL DEFAULT '0' COMMENT '数据项顺序号',
  `C_FACEFIELD` varchar(120) NOT NULL COMMENT '数据项TXT名称；接口文件中的字段名称',
  `C_BEANFIELD` varchar(120) NOT NULL COMMENT '数据项JavaBean中Field名称；我们系统中使用的名称',
  `C_CLASS` varchar(64) DEFAULT NULL COMMENT '用于数据转换用的JAVA CLASS全称',
  `C_IO` char(1) NOT NULL COMMENT '0无方向性，1输出 即将JAVABEAN转换为入参信息，2输入即将返回结果转换为JAVABEAN',
  `C_MUSTITEM` char(1) DEFAULT NULL COMMENT '0不是必须内容，1必须内容',
  `C_LEVEL` varchar(16) DEFAULT NULL COMMENT '数据项所在的位置，ROOT位于根节点 , HEAD 位于Head节点的头节点 , DATA位于数据Data节点',
  `C_VALUE_MODE` varchar(2) DEFAULT '0' COMMENT '值的处理模式，0不处理，1默认值，2参数转换，3表达式',
  `C_EXP` varchar(100) DEFAULT NULL COMMENT '如果不为空，则按表达式处理，为空默认处理；对于输出，可以将表达式定义在BeanField,输入出现表达式必须在此处',
  PRIMARY KEY (`C_FACE`,`C_FUNCODE`,`C_FACEFIELD`,`C_BEANFIELD`,`C_IO`),
  KEY `IDX_FAR_FIELDMAP` (`C_FACE`,`C_FUNCODE`,`C_FACEFIELD`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='功能的入参和出参定义';
/*!40101 SET character_set_client = @saved_cs_client */;

