--
-- Table structure for table `t_far_function`
--

DROP TABLE IF EXISTS `t_far_function`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_far_function` (
  `C_FACE` varchar(20) NOT NULL COMMENT '接口编码',
  `C_FUN` varchar(32) NOT NULL COMMENT '对应外部服务名',
  `C_CODE` varchar(32) NOT NULL COMMENT '功能代码',
  `C_NAME` varchar(100) DEFAULT NULL COMMENT '功能名称',
  `C_DESCRIPTION` varchar(200) DEFAULT NULL COMMENT '功能描述',
  `C_URL` varchar(120) DEFAULT NULL COMMENT '调用URL地址',
  `C_FACEURL` varchar(120) DEFAULT NULL COMMENT '页面调用URL地址',
  `C_INCLASS` varchar(100) DEFAULT NULL COMMENT '接口输入类信息',
  `C_OUTCLASS` varchar(100) DEFAULT NULL COMMENT '接口输出类内容；没有定义类型，将使用FaceTradeResult；接收交易结果',
  `D_MODIDATE` varchar(15) DEFAULT NULL COMMENT '修改日期',
  `C_INPUT_MODE` char(1) DEFAULT NULL COMMENT '输入数据模式；0单记录，1多记录',
  `C_OUTPUT_MODE` char(1) DEFAULT NULL COMMENT '输出数据模式；0单记录，1多记录',
  `C_INVOKE_MODE` char(1) DEFAULT '0' COMMENT '调用方式，0；使用普通http，1使用http的 MuiltPart；2使用ftp；3使用sftp； 4使用ftps； 9使用文件系统',
  `C_DATA_ENCODER` varchar(100) DEFAULT NULL COMMENT '编码器，即定义数据发送时候的序列化处理',
  `C_DATA_DECODER` varchar(100) DEFAULT NULL COMMENT '解码器，即从远程返回数据的反序列化处理',
  `C_RESULTCODE` varchar(32) DEFAULT NULL COMMENT '返回的功能代码',
  PRIMARY KEY (`C_FACE`,`C_FUN`,`C_CODE`),
  KEY `IDX_FAR_FUNCTION` (`C_FACE`,`C_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='远程接口功能描述';
/*!40101 SET character_set_client = @saved_cs_client */;

