INSERT INTO `t_risk_grade` VALUES (1,1,'0','安全型','0.00','8.00','00','0','20160411','20160411','表示您不乐意投资于任何令资本承受风险的产品。您的回报很可能只会相当于当时的利率，未必能够赶上通胀。'),(2,1,'1','保守型','9.00','14.00','00,01','0','20160411','20160411','表示您乐意接受\n？ 以一个低程度的投资风险去换取于中期（约3年）胜过一般存款的回报潜力，以及于通胀下能保障您的资本的潜力?\n资产市值可能波动并跌至低于您原本的投资额。'),(3,1,'2','稳健型','15.00','19.00','00,01,02','0','20160411','20160411','表示您乐意接受\n？  以一个较高程度的投资风险去换取于中长期（约5年）胜过存款的回报潜力，以及于通胀能保障您的资本的潜力;\n？  资产市值可能波动并跌至低于您原本的投资额;\n？  一个比‘保守型’投资者所能接受的更大的资产市值波动。'),(4,1,'3','积极型','20.00','24.00','00,01,02,03','0','20160411','20160411','表示您乐意接受\n？  于短、中、及长期均属高程度的投资风险及资产市值波幅，去换取高于通胀的回报潜力;\n？  资产市值可能波动并跌至远低于您原本的投资额;\n？  一个比‘稳健型’投资者所能接受的更大的资产市值波动。'),(5,1,'4','进取型','25.00','28.00','00,01,02,03,04','0','20160411','20160411','表示您乐意接受\n？  于短、中及长期均属非常高程度的投资风险及资产市值波幅，去换取非常高的回报潜力;\n？  资产市值可能波动并跌至远低于您原本的投资额;\n？  一个比‘积极型’投资者所能接受的更大的资产市值波幅。');
