DROP TABLE IF EXISTS `t_sale_accoconfirm`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_sale_accoconfirm` (
  `L_CUSTNO` bigint(20) NOT NULL COMMENT '客户编号',
  `C_TANO` char(2) NOT NULL COMMENT 'TA代码',
  `C_BUSINFLAG` varchar(3) DEFAULT NULL COMMENT '业务代码',
  `C_CBUSINFLAG` varchar(3) DEFAULT NULL COMMENT '确认业务代码',
  `C_TRADEACCO` varchar(17) NOT NULL COMMENT '交易账户',
  `C_FUNDACCO` varchar(12) DEFAULT NULL COMMENT '基金账户',
  `C_REQUESTNO` varchar(24) NOT NULL COMMENT '申请单号',
  `C_AGENCYNO` varchar(9) NOT NULL COMMENT '销售人代码',
  `C_NETNO` varchar(9) NOT NULL COMMENT '网点编码',
  `C_CUSTTYPE` char(1) DEFAULT NULL COMMENT '客户类型；0机构，1个人',
  `C_CUSTNAME` varchar(120) DEFAULT NULL COMMENT '客户姓名',
  `C_SHORTNAME` varchar(60) DEFAULT NULL COMMENT '客户简称',
  `C_IDENTTYPE` char(1) DEFAULT NULL COMMENT '证件类型',
  `D_CDATE` varchar(8) DEFAULT NULL COMMENT '账户确认日期',
  `D_DATE` varchar(8) DEFAULT NULL COMMENT '账户申请日期',
  `T_TIME` varchar(8) DEFAULT NULL COMMENT '账户申请时间',
  `C_STATUS` char(2) NOT NULL COMMENT '申请状态',
  `C_IDENTNO` varchar(30) DEFAULT NULL COMMENT '证件号码',
  `C_MULTIACCO` char(1) DEFAULT NULL COMMENT '多渠道开户标志',
  `C_FROMTA` char(1) DEFAULT NULL COMMENT 'TA发起业务标志 0-由代销商发起，1-由TA发起',
  `C_TACUSTNO` varchar(22) DEFAULT NULL COMMENT 'TA客户编号',
  `C_CSERIALNO` varchar(32) NOT NULL COMMENT '确认单号',
  `C_TAGET_TRADEACCO` varchar(17) NOT NULL COMMENT '对方交易帐号 对代理人申报008或058，此处赋值为新交易帐号',
  `C_CAUSE` varchar(128) DEFAULT NULL COMMENT '交易处理返回代码系统处理后返回错误信息',
  `C_ERRCODE` varchar(4) NOT NULL COMMENT '错误代码',
  `C_SPECIFICATION` varchar(128) DEFAULT NULL COMMENT '摘要说明',
  `D_FROZENENDLINE` varchar(8) DEFAULT NULL COMMENT '冻结截止日期  格式为：YYYYMMDD',
  `C_FROZENCAUSE` varchar(1) DEFAULT NULL COMMENT '冻结原因  0-司法冻结，1-柜台冻结 2-质押冻结， 3-质押(司法冻结) 4-柜台(司法冻结)',
  `C_ACCOUNTCARDNO` varchar(8) DEFAULT NULL COMMENT '基金账户卡的凭证号',
  `C_CUSTMANAGER` varchar(16) DEFAULT NULL COMMENT '客户经理代码',
  `C_CITYNO` varchar(8) DEFAULT NULL,
  `C_OPERNO` varchar(8) DEFAULT NULL COMMENT '操作员编码',
  `C_CHECKNO` varchar(8) DEFAULT NULL COMMENT '复核人编码',
  `C_REFERRAL` varchar(32) DEFAULT NULL COMMENT '推荐人姓名',
  `C_REFERRALMOBILE` varchar(16) DEFAULT NULL COMMENT '推荐人手机号码',
  `ID` bigint(20) NOT NULL COMMENT '编号',
  PRIMARY KEY (`ID`),
  KEY `IDX_SALE_ACCOCONFIRM` (`L_CUSTNO`),
  KEY `IDX_SALE_ACCOCONFIRM1` (`D_CDATE`),
  KEY `IDX_SALE_ACCOCONFIRM2` (`D_DATE`),
  KEY `IDX_SALE_ACCOCONFIRM3` (`C_CSERIALNO`,`C_TANO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户确认流水表';
