DROP TABLE IF EXISTS `t_sale_fundinfo`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_sale_fundinfo` (
  `C_TANO` varchar(4) NOT NULL COMMENT 'TA代码；对于中登的基金，管理人和TA代码不一致',
  `C_FUNDCODE` varchar(6) NOT NULL COMMENT '基金代码',
  `C_FUNDNAME` varchar(60) NOT NULL COMMENT '基金名称',
  `C_FULLNAME` varchar(100) DEFAULT NULL COMMENT '基金全称',
  `C_SHORTNAME` varchar(20) DEFAULT NULL COMMENT '基金简称',
  `C_CURRENCY` char(3) DEFAULT NULL COMMENT '货币类型',
  `F_FACEVALUE` decimal(7,4) DEFAULT NULL COMMENT '面值',
  `F_ISSUEPRICE` decimal(7,4) DEFAULT NULL COMMENT '发行价格',
  `C_MANAGER` varchar(36) DEFAULT NULL COMMENT '管理人',
  `C_TRUSTEE` varchar(36) DEFAULT NULL COMMENT '托管人',
  `C_TANAME` varchar(36) DEFAULT NULL COMMENT '注册登记机构',
  `D_ISSUEDATE` varchar(8) DEFAULT NULL COMMENT '发行日期',
  `D_SETUPDATE` varchar(8) DEFAULT NULL COMMENT '成立日期',
  `F_MANAGERATIO` decimal(5,4) DEFAULT NULL COMMENT '管理费率',
  `F_SERVICERATIO` decimal(5,4) DEFAULT NULL COMMENT '销售服务费率',
  `C_STATUS` char(1) DEFAULT '1' COMMENT '状态； 0停用，1启用',
  `C_FEETYPE` char(1) DEFAULT NULL COMMENT '费用计算方式',
  `C_SHARETYPE` char(1) DEFAULT NULL COMMENT '份额类别  A-前收费,B-后收费(销售专用)',
  `C_TYPE` varchar(2) DEFAULT NULL COMMENT '基金类别基金品牌0-普通基金 1-货币市场基金 2-短债类基金 3-债券型基金 4-指数型基金 5-保本基金 6-QDII基金, 11利得盈/12建行财富/13乾图/14乾元/21汇得盈/22 QDII /23对公债券产品/24本外币组合产品/31自动理财账户-新股随心打/41龙信/XX组合产品',
  `F_MINSHARE` decimal(16,2) DEFAULT NULL COMMENT '最小持有份额',
  `C_RISKLEVEL` char(2) DEFAULT NULL COMMENT '风险级别',
  `N_LIQUIDATE` smallint(6) DEFAULT '1' COMMENT '交易清算天数；普通基金是1天，QDII基金是2天',
  `D_REGDATE` varchar(8) DEFAULT NULL COMMENT '登记日期',
  `D_MODIDATE` varchar(15) DEFAULT NULL COMMENT '修改日期',
  `C_DESCRIPTION` varchar(200) DEFAULT NULL COMMENT '产品描述',
  `C_GROUP` varchar(40) DEFAULT NULL COMMENT '基金分组',
  `C_BRAND` varchar(20) DEFAULT NULL COMMENT '自定义分类',
  `C_SHARECLASS` varchar(5) DEFAULT NULL COMMENT '支持的基金分级(数据字段)--复选 A-前收费,B-后收费',
  `C_CRSCCODE` varchar(6) DEFAULT NULL COMMENT '证监会基金代码，主要用于分级基金',
  `C_SUBTYPE` varchar(2) DEFAULT NULL COMMENT '产品子类型,11 - 固定期限债券及货币市场工具类:7天/14天/1个月/2个月/3个月(期限类别应可扩展)/12 - 滚动发行债券及货币市场工具类/21 - 挂钩利率结构类/22 - 挂钩汇率结构类/23 - 挂钩信用结构类/24 - 挂钩股票结构类/25 - 挂钩商品结构类/26 - 挂钩指数结构类/ 27 –挂钩基金结构类/28 - 挂钩其他标的类/29 - 组合挂钩结构类（注：上述挂钩标的的组合）/31 - 基于票据资产理财类/41 - 资本市场打新股信托类/42 - 资本市场基金信托类/43 -',
  `C_BONUSTYPE` char(1) DEFAULT '0' COMMENT '默认分红方式；分红方式  0-现金分红 1-红利再投',
  `F_MAXSHARE` decimal(16,2) DEFAULT NULL COMMENT '最高持有份额',
  `T_TIME` varchar(8) DEFAULT NULL COMMENT '(销售专用)  申购期收市时间    空或者全0 表示无设置',
  `T_SUBSLASTTIME` varchar(8) DEFAULT NULL COMMENT '(销售专用)  认购最后一天收市时间  空或者全0 表示无设置',
  `T_SUBSTIME` varchar(8) DEFAULT NULL COMMENT '(销售专用)  认购收市时间       空或者全0 表示无设置',
  `C_ACCEPT` varchar(32) DEFAULT NULL COMMENT '受理方式 ；0柜台，1电话，2网上交易，3传真，4手机，5其它',
  `C_CYCLE` char(1) DEFAULT NULL COMMENT '(销售专用)理财产品周期 0 按月  1 按季	',
  `D_IPOENDDATE` char(8) DEFAULT NULL COMMENT '(销售专用) 基金募集结束日期',
  `C_BUSINFLAG` varchar(32) DEFAULT NULL COMMENT '(销售专用)业务开关',
  `C_MANAGERNO` varchar(4) DEFAULT NULL COMMENT '管理人代码',
  `C_CLASS` varchar(2) DEFAULT NULL COMMENT '产品大类，00普通基金，01理财产品，02专户基金，03封闭基金，04QDII基金；10普通组合基金',
  `C_TRUSTEENO` varchar(3) DEFAULT NULL COMMENT '托管人代码',
  `N_ORDER` smallint(6) DEFAULT '0' COMMENT '排序',
  `C_URL` varbinary(100) DEFAULT NULL,
  PRIMARY KEY (`C_FUNDCODE`),
  KEY `IDX_SALE_FUNDINFO` (`C_FUNDCODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基金基本信息';
/*!40101 SET character_set_client = @saved_cs_client */;

