--
-- Table structure for table `t_sale_request`
--

DROP TABLE IF EXISTS `t_sale_request`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_sale_request` (
  `L_CUSTNO` bigint(20) NOT NULL COMMENT '客户编号',
  `C_TRADEACCO` varchar(17) NOT NULL COMMENT '交易账户',
  `C_TANO` char(2) NOT NULL COMMENT 'TA代码',
  `C_FUNDACCO` varchar(12) DEFAULT NULL COMMENT '基金账户',
  `C_REQUESTNO` varchar(24) NOT NULL COMMENT '申请单号',
  `C_AGENCYNO` varchar(9) NOT NULL COMMENT '销售人代码',
  `C_NETNO` varchar(9) NOT NULL COMMENT '网点编码',
  `C_ERRDETAIL` varchar(128) DEFAULT NULL COMMENT '交易申请结果描述',
  `C_CAUSE` varchar(128) DEFAULT NULL COMMENT '交易处理返回代码系统处理后返回错误信息',
  `C_CSERIALNO` varchar(32) DEFAULT NULL COMMENT '确认单号',
  `D_CDATE` char(8) DEFAULT NULL COMMENT 'TA确认日期',
  `C_FUNDCODE` varchar(6) DEFAULT NULL COMMENT '基金代码',
  `C_SHARETYPE` char(1) DEFAULT NULL COMMENT '份额类别',
  `C_OLD_CSERIALNO` varchar(32) DEFAULT NULL COMMENT '原TA确认流水号',
  `C_OLD_REQUESTNO` varchar(32) DEFAULT NULL COMMENT '原申请单编号',
  `D_OLD_DATE` char(8) DEFAULT NULL COMMENT '原申请日期',
  `F_OLD_DISCOUNT` decimal(5,4) DEFAULT NULL COMMENT '原销售佣金折扣率  对投资人的总佣金折扣率，取值为投资人实付佣金/投资人应付佣金',
  `D_OLD_CDATE` char(8) DEFAULT NULL COMMENT 'TA的原确认日期',
  `D_DATE` varchar(8) DEFAULT NULL COMMENT '交易申请日期',
  `T_TIME` varchar(8) DEFAULT NULL COMMENT '申请时间',
  `F_SHARE` decimal(16,2) DEFAULT '0.00' COMMENT '申请份额',
  `F_BALANCE` decimal(16,2) DEFAULT '0.00' COMMENT '申请金额',
  `F_CONFIRMBALANCE` decimal(16,2) DEFAULT '0.00' COMMENT '确认金额',
  `F_CONFIRMSHARES` decimal(16,2) DEFAULT '0.00' COMMENT '确认份额',
  `C_CURRENCY` char(3) DEFAULT NULL COMMENT '结算币种',
  `F_DISCOUNT` decimal(5,4) DEFAULT NULL COMMENT '销售佣金折扣率  对投资人的总佣金折扣率，取值为投资人实付佣金/投资人应付佣金',
  `C_TAGET_FUNDCODE` varchar(6) DEFAULT NULL COMMENT '对方基金代码',
  `C_TAGET_SHARETYPE` char(1) DEFAULT NULL COMMENT '对方份额类别',
  `C_TAGET_TRADEACCO` varchar(17) DEFAULT NULL COMMENT '对方交易账户',
  `C_TAGET_FUNDACCO` varchar(12) DEFAULT NULL COMMENT '对方基金账号',
  `C_TAGET_AGENCYNO` char(3) DEFAULT NULL COMMENT '对方销售商',
  `C_TAGET_NETNO` varchar(10) DEFAULT NULL COMMENT '对方网点   转销售商、非交易过户时使用',
  `C_BONUSTYPE` char(1) DEFAULT NULL COMMENT '分红方式',
  `C_FROZENCAUSE` char(1) DEFAULT NULL COMMENT '冻结原因',
  `D_FROZENENDLINE` varchar(8) DEFAULT NULL COMMENT '冻结截止日期',
  `D_OPERDATE` varchar(8) DEFAULT NULL COMMENT '下单日期',
  `T_OPERTIME` varchar(8) DEFAULT NULL COMMENT '下单时间',
  `C_CANCELFLAG` char(1) DEFAULT NULL COMMENT '撤单标志',
  `C_PRESTATUS` char(1) NOT NULL COMMENT '预约单状态',
  `C_PAYSTATUS` char(2) DEFAULT NULL COMMENT '支付状态；00未支付，01委托正在处理，02支付成功，03支付失败，07托收成功',
  `C_STATUS` char(2) NOT NULL COMMENT '申请状态；0未处理，1下单成功，2下单失败，3撤单作废，4等待签约，5签约失败，6正在处理，7系统作废，8确认失败，9确认成功',
  `C_LAST_STATUS` char(2) NOT NULL COMMENT '上次申请状态',
  `C_ORDER_FLAG` char(1) NOT NULL COMMENT '下单方式(0 客户下单 1 系统自动下单)',
  `C_BROKER` varchar(8) DEFAULT NULL COMMENT '经纪人',
  `C_OPERNO` varchar(8) DEFAULT NULL COMMENT '操作员编码',
  `C_CHECKNO` varchar(8) DEFAULT NULL COMMENT '复核人编码',
  `C_CONTACT` varchar(30) DEFAULT NULL COMMENT '经办人姓名',
  `C_PROMOTION` varchar(32) DEFAULT NULL COMMENT '促销活动代码',
  `C_IPADDR` varchar(32) DEFAULT NULL COMMENT '网络地址',
  `C_PAYCENTER` varchar(9) DEFAULT NULL COMMENT '分中心',
  `C_CUSTMANAGER` varchar(16) DEFAULT NULL COMMENT '客户经理代码',
  `C_REFERRAL` varchar(32) DEFAULT NULL COMMENT '推荐人姓名',
