CREATE TABLE `t_sale_sharedetail` (
  `C_TANO` char(2) NOT NULL COMMENT 'TA代码',
  `D_DATE` varchar(8) DEFAULT NULL COMMENT '确认日期',
  `L_CUSTNO` bigint(20) NOT NULL COMMENT '客户编号',
  `C_FUNDACCO` varchar(12) DEFAULT NULL COMMENT '基金账户',
  `C_AGENCYNO` varchar(9) NOT NULL COMMENT '销售人代码',
  `C_NETNO` varchar(9) NOT NULL COMMENT '网点编码',
  `C_TRADEACCO` varchar(17) NOT NULL COMMENT '交易账户',
  `C_CONTRACTNO` varchar(32) DEFAULT NULL COMMENT '合同号  可填写定期定额协议号、信托合同号、合约编号、冻结的法律文书编号等',
  `C_FUNDCODE` varchar(6) DEFAULT NULL COMMENT '基金代码',
  `C_SHARETYPE` char(1) DEFAULT NULL COMMENT '份额类别',
  `C_SHARECLASS` char(1) NOT NULL COMMENT '份额级别',
  `C_CUSTTYPE` char(1) DEFAULT NULL COMMENT '客户类别',
  `F_SHARES` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '当日变动份额[发生]；根据交易明细汇总的份额信息',
  `C_CSERIALNO` varchar(32) DEFAULT NULL COMMENT '确认单号',
  `C_OLD_CSERIALNO` varchar(32) NOT NULL COMMENT '原确认流水号(转托管、非交易过户后保留)',
  `C_REQUESTNO` varchar(32) NOT NULL COMMENT '申请单编号',
  `C_BUSINFLAG` char(3) DEFAULT NULL COMMENT '份额来源；具体内容是业务代码',
  `D_REGDATE` varchar(8) DEFAULT NULL COMMENT '注册日期',
  `F_LAST_SHARES` decimal(16,2) NOT NULL COMMENT '昨日基金份数余额',
  `F_CONFIRMSHARES` decimal(16,2) DEFAULT NULL COMMENT '确认份额；通过交易确认明细变动的份额',
  `F_LAST_FROZEN` decimal(16,2) NOT NULL COMMENT '昨日交易冻结份额',
  `F_FROZEN` decimal(16,2) NOT NULL COMMENT '当日交易冻结份额[发生]',
  `F_LAST_BONUSTYPE` char(1) NOT NULL COMMENT '上次红方式',
  `C_BONUSTYPE` char(1) NOT NULL COMMENT '分红方式',
  `F_FEETIMES` int(11) NOT NULL COMMENT '计提次数',
  `F_DISCOUNT` decimal(5,4) NOT NULL COMMENT '折扣',
  `F_NETVALUE` decimal(7,4) NOT NULL COMMENT '认申购净值',
  `L_PROTOCOLNO` bigint(20) DEFAULT NULL COMMENT '协议代码(包括定时定额的协议)',
  `D_MODIDATE` varchar(15) DEFAULT NULL COMMENT '修改日期',
  `ID` bigint(20) NOT NULL COMMENT '编号',
  PRIMARY KEY (`ID`),
  KEY `IDX_SALE_SHAREDETAIL` (`L_CUSTNO`),
  KEY `IDX_SALE_SHAREDETAIL1` (`C_TRADEACCO`),
  KEY `IDX_SALE_SHAREDETAIL2` (`C_FUNDACCO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='份额明细信息';
