DROP TABLE IF EXISTS `t_sale_tainfo`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_sale_tainfo` (
  `C_TANO` varchar(6) NOT NULL COMMENT 'TA代码',
  `C_SHORTNAME` varchar(16) DEFAULT NULL COMMENT '简称',
  `C_NAME` varchar(64) DEFAULT NULL COMMENT '名称',
  `C_ZIPCODE` varchar(16) DEFAULT NULL COMMENT '邮编',
  `C_CONTACT` varchar(56) DEFAULT NULL COMMENT '联系人',
  `C_PHONE` varchar(56) DEFAULT NULL COMMENT '电话',
  `C_MOBILENO` varchar(56) DEFAULT NULL COMMENT '手机号码',
  `C_FAXNO` varchar(56) DEFAULT NULL COMMENT '传真号码',
  `C_EMAIL` varchar(162) DEFAULT NULL COMMENT 'email地址',
  `C_ADDRESS` varchar(128) DEFAULT NULL COMMENT '通讯地址',
  `C_BANKNO` varchar(10) NOT NULL COMMENT '银行编码',
  `C_BANKACCO` varchar(32) DEFAULT NULL COMMENT '银行帐号',
  `C_BANKNAME` varchar(64) DEFAULT NULL COMMENT '银行全称',
  `C_CLEAR_ORG` varchar(16) DEFAULT NULL COMMENT '基金资金清算机构代码',
  `C_STATUS` char(1) NOT NULL COMMENT '状态',
  `C_TYPE` char(1) NOT NULL COMMENT '类型0自TA，1中登深圳TA，2中登上海TA',
  `D_MODIDATE` varchar(15) NOT NULL COMMENT '最后更新日期',
  `D_REGDATE` char(8) NOT NULL COMMENT '开户日期',
  `C_CHKMODE` char(1) NOT NULL COMMENT '汇总对账模式  0 双向对帐 1 以基金公司为准   2 以代销商为准',
  `C_BUSINFLAG` varchar(32) DEFAULT NULL COMMENT '业务控制标志(按位来控制)',
  `C_CLEAR_STATUS` char(1) NOT NULL COMMENT '清算状态 0 正常 1 清算完毕 2 交收中 3 交收完毕 4 初始化中  (属性字段)',
  `C_VALID` char(1) NOT NULL COMMENT '交收完毕后份额是否实时可用 0 可用 1 不可用',
  `C_CSRCTANO` varchar(16) DEFAULT NULL COMMENT '证监会TA代码',
  `C_BANKACCONAME` varchar(64) DEFAULT NULL COMMENT '银行户名',
  `C_ERRMODE` varchar(8) DEFAULT NULL COMMENT '错误模板；每个TA 系统对应一套错误模板；相同的TA开发商使用一套模板',
  `C_FIRST_BASIS` char(1) DEFAULT NULL COMMENT '首次投资判断：1、TA中有份额记录，2、TA中有交易申请，3、基金中有份额记录，4、基金中有交易申请',
  `C_OPERNO` varchar(8) DEFAULT NULL COMMENT '操作员',
  `C_NETNO` varchar(9) DEFAULT NULL COMMENT '网点编码',
  `D_CLEARDATE` varchar(8) DEFAULT NULL COMMENT '清算日期，即该机构已经清算的数据日期，将根据该日期计算存量情况！',
  `C_PAYCENTER` varchar(9) DEFAULT NULL COMMENT '分中心',
  `C_SALE_AGENCYNO` varchar(9) DEFAULT NULL COMMENT '基金公司销售人代码',
  `C_URL` varchar(100) DEFAULT NULL COMMENT '基金公司URL地址',
  `C_RELA_CUSTNO` varchar(30) DEFAULT NULL COMMENT '关联的客户编号',
  PRIMARY KEY (`C_TANO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='注册登记机构信息';
/*!40101 SET character_set_client = @saved_cs_client */;

